import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
   Card, CardTitle, Col, Row,CardText
} from 'reactstrap';


export default function Resultado(props) {

    return (

        <Row>
            <Col sm="6">
                {props.result.filter((pregunta, index) => ( 
                    <Card
                        key={index}
                        body
                        className="my-2"
                        style={{
                            width: '30rem'

                        }}
                    >
                        <CardTitle tag="h5">
                            {props.contador}{pregunta.tipo}
                        </CardTitle>
                        <CardText>
                        {pregunta.descripcion}
                         </CardText>
                    </Card>
                ))}


            </Col>
        </Row>
    );
}
